import{_ as e,c as o,o as t,a7 as n}from"./chunks/framework.DkJ47SOg.js";const m=JSON.parse('{"title":"Finding Version Numbers","description":"","frontmatter":{"prev":{"text":"Further Support","link":"/guides/further-support/#getting-support"},"next":false},"headers":[],"relativePath":"guides/further-support/version-numbers.md","filePath":"guides/further-support/version-numbers.md","lastUpdated":1709410508000}'),r={name:"guides/further-support/version-numbers.md"},s=n('<h1 id="finding-version-numbers" tabindex="-1">Finding Version Numbers <a class="header-anchor" href="#finding-version-numbers" aria-label="Permalink to &quot;Finding Version Numbers&quot;">​</a></h1><p>To identify the version numbers of various components, follow these steps:</p><h2 id="the-app" tabindex="-1">The App <a class="header-anchor" href="#the-app" aria-label="Permalink to &quot;The App&quot;">​</a></h2><p>The version number of the app can be found at the bottom of the app&#39;s Settings page.</p><h2 id="an-extension" tabindex="-1">An Extension <a class="header-anchor" href="#an-extension" aria-label="Permalink to &quot;An Extension&quot;">​</a></h2><p>Locate the version number of the extension from within the app using the following steps:</p><ol><li>Go to the <strong>Settings</strong> page.</li><li>Go to <strong>Extensions</strong>.</li><li>Look for the relevant extension.</li><li>You can find the version number bellow the extension its name. <blockquote><p>e.g. <strong>1.2.12</strong></p></blockquote></li></ol><div class="warning custom-block"><p class="custom-block-title">No Support Provided for Third-Party Extensions</p><p>Ensure your question is not related to third-party extensions, as we do not maintain those and cannot offer assistance (<a href="/getting-started/adding-content#third-party-extensions">Learn more</a>)!</p></div><h2 id="your-operating-system-os" tabindex="-1">Your Operating System (OS) <a class="header-anchor" href="#your-operating-system-os" aria-label="Permalink to &quot;Your Operating System (OS)&quot;">​</a></h2><h3 id="your-ios-device-iphones" tabindex="-1">Your iOS Device (iPhones) <a class="header-anchor" href="#your-ios-device-iphones" aria-label="Permalink to &quot;Your iOS Device (iPhones)&quot;">​</a></h3><p>For devices running iOS, navigate to <strong>Settings</strong> &gt; <strong>General</strong> &gt; <strong>About</strong> &gt; <strong>iOS Version</strong>.</p><blockquote><p>e.g. <strong>16.2</strong></p></blockquote><h3 id="your-ipados-device-ipads" tabindex="-1">Your iPadOS Device (iPads) <a class="header-anchor" href="#your-ipados-device-ipads" aria-label="Permalink to &quot;Your iPadOS Device (iPads)&quot;">​</a></h3><p>For devices running iPadOS, navigate to <strong>Settings</strong> &gt; <strong>General</strong> &gt; <strong>About</strong> &gt; <strong>iPadOS Version</strong>.</p><blockquote><p>e.g. <strong>16.2</strong></p></blockquote><h3 id="your-macos-device-macs" tabindex="-1">Your macOS Device (Macs) <a class="header-anchor" href="#your-macos-device-macs" aria-label="Permalink to &quot;Your macOS Device (Macs)&quot;">​</a></h3><p>MacOS devices, find the OS version in the <strong>Apple menu</strong> (Top left) &gt; <strong>About This Mac</strong> &gt; <strong>macOS</strong>.</p><blockquote><p>e.g. <strong>Sonoma 14.2</strong></p></blockquote>',18),i=[s];function a(u,p,d,c,g,h){return t(),o("div",null,i)}const b=e(r,[["render",a]]);export{m as __pageData,b as default};
